import React from "react";
import { useParams } from "react-router-dom";
import Games from "../components/AllGames/casinogame.json";


function Gameplay() {
  const { gameName } = useParams();

  // Ovdje preuzmite sliku na osnovu imena igre (gameName) iz vašeg JSON-a ili odakle god da je
  const gameImage = Games.casinogame.find((casinogame) => casinogame.name === gameName)?.image;

  return (
    <div>
      {/* Prikazivanje samo slike */}
      <div className="app">

      <img src={gameImage} alt={gameName} />
    </div>
    </div>
  );
}

export default Gameplay;
